import timeit
def sortJumbled( mapping: list[int], nums: list[int]) -> list[int]:
        mapp=[]
        res=[]
        for n in nums:
            nn=""
            n=str(n)
            for l in n:
                l=int(l)
                nn+=str(mapping[l])
            mapp.append(int(nn))
        while len(nums)>0:
            mino=min(mapp)
            index=mapp.index(mino)
            res.append(nums[index])
            nums.pop(index)
            mapp.pop(index)
        return res

